import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import * as cal from './Heading'
import contact from './contacts'
import {  BrowserRouter as Router,Route, Routes, Link, Navigate} from 'react-router-dom'

var lp = window.location.pathname.slice(1)

function createCardz(contact) {
    if (contact.name == {lp})
    return (
      <cal.default 
      id = {contact.id}
      image = {contact.image}
      name = {contact.name}
      ngayph = {contact.ngayph}
      theloai = {contact.theloai}
      solike = {contact.solike}
      sodislike = {contact.sodislike}
      socmt = {contact.socmt}
       />
    )
}
  function Xam() {
    return (
        <div className = "thegame">
        {contact.map(createCardz)}
        </div>
    )
  }

export default Xam
